import Register from './components/Register/Register.jsx';
import Page2 from './components/Page2/Page2.jsx';
function App() {
  return (
    <div className="App">
      <div className="appClass">
        <h3>sa</h3>
        <Router>
          <Routes>
            <Route path="/" exact>
              <Login />
              <Link to="/page2" className="link">
                Page
              </Link>
            </Route>
            <Route path="/Register">
              <Register />
              <Link to="/page2">Page</Link>
            </Route>
            <Route path="/Page2">
              <Page2 />
            </Route>
          </Routes>
        </Router>
        <Login />
      </div>
    </div>
  );
}

export default App;
